import React from 'react';
import {
  StyleSheet,
  View,
  Text,
  Dimensions,
  Image,
  SafeAreaView,
StatusBar
} from 'react-native';
import ImagedCarouselCard from "react-native-imaged-carousel-card";

const Slider = () => {
  const images = [
    'https://placeimg.com/640/640/nature',
    'https://placeimg.com/640/640/people',
    'https://placeimg.com/640/640/animals',
    'https://placeimg.com/640/640/beer',
  ];

  return (
    <>
      <StatusBar barStyle="dark-content" />
      <SafeAreaView>
        <View
          style={{
            top: 32,
            alignItems: "center",
            justifyContent: "center"
          }}
        >
          <ImagedCarouselCard
            height={200}
            width={200}
            shadowColor="#051934"
            source={{
              uri:
                "https://images.unsplash.com/photo-1501594907352-04cda38ebc29?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=1189&q=80"
            }}
          />
          <View style={{ marginTop: 32 }}>
            <ImagedCarouselCard />
          </View>

          <View style={{ marginTop: 32 }}>
            <ImagedCarouselCard
              height={200}
              width={200}
              shadowColor="#051934"
              source={{
                uri:
                  "https://images.unsplash.com/photo-1503891450247-ee5f8ec46dc3?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=634&q=80"
              }}
            />
          </View>
        </View>
      </SafeAreaView>
    </>
  );
}


const styles = StyleSheet.create({
  container:{
    // flex:1,
    // flexDirection:'row',
    height:130,

  }
});
export default Slider;
